// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmMenu 
} from '@vime/core';

import { define } from '../lib';


define('vm-menu', VmMenu);


export interface MenuProps extends JSX.VmMenu, HTMLAttributes<HTMLVmMenuElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmMenuElement, MenuProps>(
  'vm-menu',
  new Set(['active','identifier','controller','slideInDirection']),
);
